import React from 'react';
import logo from './logo.svg';
import './App.css';

import {Layout} from 'antd';
import HeaderComponent from "./components/Header";
import ContentComponent from "./components/Content";

const {Header, Footer, Content} = Layout;

function App() {

    return (
        <Layout>
            <HeaderComponent/>
            <ContentComponent/>
            <FooterComponent/>
        </Layout>
    );
}

export default App;
